fn main() {
    let mut count = 0;
    let lines = INPUT.lines().collect::<Vec<_>>();
    for l in lines.iter() {
        for i in 0..(l.len()-3) {
            if l[i..(i+4)] == *"XMAS" || l[i..(i+4)] == *"SAMX" {
                count += 1;
            }
        }
    }
    dbg!(count);
    for c in 0..lines[0].len() {
        let mut col = String::new();
        for l in lines.iter() {
            col.push_str(&l[c..=c]);
        }
        for i in 0..(col.len()-3) {
            if col[i..(i+4)] == *"XMAS" || col[i..(i+4)] == *"SAMX" {
                count += 1;
            }
        }
    }
    dbg!(count);
    for x in 0..(lines.len()+lines[0].len()) {
        let mut diag = String::new();
        for y in 0..=x.min(lines.len()-1) {
            if let Some(ch) = lines[y].chars().nth(x-y) {
                diag.push(ch);
            }
        }
        if diag.len() < 4 {
            continue;
        }
        for i in 0..(diag.len()-3) {
            if diag[i..(i+4)] == *"XMAS" || diag[i..(i+4)] == *"SAMX" {
                count += 1;
            }
        }
    }
    dbg!(count);
    for x in 0..(lines.len()+lines[0].len()) {
        let mut diag = String::new();
        for y in 0..=x.min(lines.len()-1) {
            match lines[0].len().checked_sub(x-y) {
                Some(i) => if let Some(ch) = lines[y].chars().nth(i) {
                    diag.push(ch);
                },
                None => continue
            }
        }
        dbg!(&diag);
        if diag.len() < 4 {
            continue;
        }
        for i in 0..(diag.len()-3) {
            if diag[i..(i+4)] == *"XMAS" || diag[i..(i+4)] == *"SAMX" {
                count += 1;
            }
        }
    }
    dbg!(count);
}

